        /* pdf*/
        b.off("click", ".js_pdf").on("click", ".js_pdf", function(a) {
            var targetDom = $("#print");
            //pdfclone
            var copyDom = targetDom.clone();
            //div
            copyDom.width(targetDom.width() + "px");
            copyDom.height(targetDom.height()+50 + "px");
            $('body').append(copyDom);//ps:copyDom appendbodyglyphicons2canvas

            svg2canvas(copyDom);
            html2canvas(copyDom, {
                onrendered: function (canvas) {

                    var context = canvas.getContext('2d');        
                    //         
                    context.mozImageSmoothingEnabled = false;       
                     context.webkitImageSmoothingEnabled = false;     
                        context.msImageSmoothingEnabled = false;      
                          context.imageSmoothingEnabled = false;


                    var imgData = canvas.toDataURL('image/jpeg');
                    var img = new Image();
                    img.src = imgData;
                    //pdf*0.225
                    img.onload = function () {

                        var contentWidth = canvas.width;
                        var contentHeight = canvas.height-40;
    
                        //pdfhtmlcanvas;
                        var pageHeight = contentWidth / 595.28 * 841.89+50;
                        //pdfhtml
                        var leftHeight = contentHeight;

                        //pdf
                        var position = 20;
                        //a4[595.28,841.89]htmlcanvaspdf
                        var imgWidth = 555.28;
                        var imgHeight = 555.28/contentWidth * contentHeight-50;
    
    
                        var pageData = canvas.toDataURL('image/jpeg', 1.0);
    
                        var pdf = new jsPDF('', 'pt', 'a4');
                        //htmlpdf(841.89)
                        //pdf
                        if (leftHeight < pageHeight) {
                            pdf.addImage(pageData, 'JPEG', 20, position, imgWidth, imgHeight );
                        } else {
                            while(leftHeight > 0) {
                                pdf.addImage(pageData, 'JPEG', 20, position, imgWidth, imgHeight)
                                leftHeight -= pageHeight;
                                position -= 841.89;
                                //
                                if(leftHeight > 0) {
                                    pdf.addPage();
                                }
                            }
                        }
                        
                        pdf.save('_'+$('#filterName').val() + '.pdf');
                    };
                    //div
                    copyDom.remove();
                },
                background: "#fff",
                scale:2,
                logging:false,
                //html
                allowTaint: true //falsehtml2canvas
            });


            function svg2canvas(targetElem) {
                var svgElem = targetElem.find('svg');
                svgElem.each(function (index, node) {
                    var parentNode = node.parentNode;
                    //IEsvgnodedivdivinnerHTML
                    var tempNode = document.createElement('div');
                    tempNode.appendChild(node);
                    var svg = tempNode.innerHTML;
                    var canvas = document.createElement('canvas');
                    //
                    canvg(canvas, svg);
                    parentNode.appendChild(canvas);
                });
            }

        })

        
